import React from 'react';
import { Link, withRouter } from 'react-router-dom';
import { Navbar, Nav, NavItem } from 'react-bootstrap';
import logo from './images/FruitionLogo1.png';

// Assessment
// Notes
// Calendar
// Logout
const Navigation = ({ history }) => (
	<div>
		<Navbar inverse fixedTop collapseOnSelect>
			<Navbar.Collapse>
				<Nav pullRight>
					<NavItem eventKey={1} onClick={() => history.push('/calendar')}>
						Calendar
					</NavItem>
					<NavItem eventKey={2} onClick={() => history.push('/fruition')}>
						Assessment
					</NavItem>
					<NavItem eventKey={3} onClick={() => history.push('/dashboard')}>
						Dashboard
					</NavItem>
					<NavItem eventKey={4} onClick={() => history.push('/notes')}>
						Notes
					</NavItem>
				</Nav>
			</Navbar.Collapse>
		</Navbar>
	</div>
);

export default withRouter(Navigation);
